import React from "react";

export const ProductCard = ({ props }) => {
  const { id, name, price, imageUrl } = props;

  return (
    <div>
      {props.map(({ id, name, price, imageUrl }) => {
        return (
          <div key={id}>
            <h2>{name}</h2>
            <img src={imageUrl} />
            <h2>{price}</h2>
          </div>
        );
      })}
    </div>
  );
};
